import React from 'react'
import results from '../data/results' ;
import 'bootstrap/dist/css/bootstrap.min.css';

function Result({id}){
	return(
		<div>
			<div className = "card-header">
				U heeft mogelijk <b>{results[id][0]}</b> gevonden... <br/>
				Check de kenmerken om te kijken of dit inderdaad de plant is die u heeft gevonden.

			</div>
			<div className="card-body"> 
				<Col>
				<b>{results[id][0]}</b> ({results[id][1]}) <br/>
				{results[id][2]}
				</Col>
				<Col>
				<img src={require('../images/result/' + id + '.jpeg').default} alt={require('../images/LogoHortus.png')} width="60%"></img>
				</Col>
				<div className="text">
					Is dit het plantje dat u gevonden heeft?
				</div>
			</div>
		</div>
	);
}

export default Result
